func (h *HelpFeedbackRepo) DeleteMultiUnscopedCacheByUserIDSTx(ctx context.Context, tx *ai_boilerplate_dao.Query, userIDS []string) error {
	dao := tx.HelpFeedback
	result, err := dao.WithContext(ctx).Unscoped().Where(dao.UserID.In(userIDS...)).Find()
	if err != nil {
		return err
	}
	if len(result) == 0 {
		return nil
	}
	_, err = dao.WithContext(ctx).Unscoped().Where(dao.UserID.In(userIDS...)).Delete()
	if err != nil {
		return err
	}
	err = h.DeleteIndexCache(ctx, result...)
	if err != nil {
		return err
	}
	return nil
}

// DeleteUniqueIndexCache 删除索引存在的缓存
func (h *HelpFeedbackRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.HelpFeedback) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, h.cache.Key(CacheHelpFeedbackByConditionPrefix))
	keys = append(keys, h.cache.Key(CacheHelpFeedbackUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[h.cache.Key(CacheHelpFeedbackByIDPrefix, item.ID)] = struct{}{}
			KeyMap[h.cache.Key(CacheHelpFeedbackUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[h.cache.Key(CacheHelpFeedbackByStatusPrefix, item.Status)] = struct{}{}
			KeyMap[h.cache.Key(CacheHelpFeedbackUnscopedByStatusPrefix, item.Status)] = struct{}{}
			KeyMap[h.cache.Key(CacheHelpFeedbackByUserIDPrefix, item.UserID)] = struct{}{}
			KeyMap[h.cache.Key(CacheHelpFeedbackUnscopedByUserIDPrefix, item.UserID)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := h.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
